import React from 'react';

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      name: 'hi',
      fam: [{ gName: 'ace', age: 27 }, { gName: 'granny', age: 25 }]
    };
  }
  render() {
    return (
      <div>
        <h1>Connected</h1>
        {this.state.fam.gName.map(name => name)}
      </div>
    );
  }
}

export default App;
